import ExpenseItem from "./Components/ExpenseItem";





function App() {

  const expences = [
    {
        id:'el1',
        title: 'pattaya',
        date: new Date(2022,4,16),

    },
    {
      id:'el2',
      title:'Bankok',
      date: new Date(2022,4,19),

    },
    {
      id:'el3',
      title:'Kaulalampur',
      date: new Date(2022,4,21),
    },
    {
      id:'el4',
      title:'bali',
      date: new Date(2022,4,24),
    },
  ];

  return (
    <div>
      <h1>Hey shravan lets start your first project</h1>
      <ExpenseItem title={expences[0].title} date={expences[0].date}></ExpenseItem>
      <ExpenseItem title={expences[1].title} date={expences[1].date}></ExpenseItem>
      <ExpenseItem title={expences[2].title} date={expences[2].date}></ExpenseItem>
      <ExpenseItem title={expences[3].title} date={expences[3].date}></ExpenseItem>


    </div>
  );
}

export default App;
